pragma solidity ^0.8.0;

import "@openzeppelin/contracts/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/introspection/IERC165.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";

import "./interface/INFT.sol";
import "./core/CoreNFT.sol";

contract NFTV1 is INFT, Ownable, CoreNFT, Initializable {
    // solhint-disable-next-line
    constructor() ERC721("", "") {}

    /// @dev MUST call when proxy deployment
    ///  Using `openzeppelin-contracts/contracts/proxy/transparent/TransparentUpgradeableProxy.sol`.
    ///  Therefore doesn't setup `onlyOwner`.
    function init(
        string memory name_,
        string memory symbol_,
        address owner_
    ) external initializer {
        _setName(name_);
        _setSymbol(symbol_);
        _transferOwnership(owner_);
    }

    /** ===== ===== ===== ===== ===== ===== ===== ===== ===== =====
     * Admin Mutable Function
    ===== ===== ===== ===== ===== ===== ===== ===== ===== ===== */
    /// @notice airdrop for use
    function airdrop(
        address account_,
        string memory uri_
    ) external onlyOwner {
       _mint(account_, uri_);
    }

    /// @notice burn token
    function burn(uint256 id_) public onlyExistingNft(id_) onlyOwner {
        _burn(id_);
    }

    /// @notice setup uri
    function setURI(uint256 tokenId_, string memory uri_) external onlyExistingNft(tokenId_) onlyOwner {
        _setURI(tokenId_, uri_);
    }

    /** ===== ===== ===== ===== ===== ===== ===== ===== ===== =====
     * View Functions
    ===== ===== ===== ===== ===== ===== ===== ===== ===== ===== */
    function getOwnedTokens(address address_)
        external
        view
        returns (TokenView[] memory)
    {
        uint256 balance_ = ERC721.balanceOf(address_);
        TokenView[] memory tokens_ = new TokenView[](balance_);
        if (balance_ > 0) {
            for (uint256 i = 0; i < balance_; i++) {
                uint256 id_ = tokenOfOwnerByIndex(address_, i);
                string memory uri_ = tokenURI(id_);
                tokens_[i] = TokenView(id_, uri_);
            }
        }
        return tokens_;
    }

    /** ===== ===== ===== ===== ===== ===== ===== ===== ===== =====
     * Modifiers
    ===== ===== ===== ===== ===== ===== ===== ===== ===== ===== */
    /// @notice check if nft is existed
    modifier onlyExistingNft(uint256 id_) {
        require(_exists(id_), "NFT: nonexistent token");
        _;
    }

    /// @dev lock transfer when token is locked
    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId
    ) internal override {
        super._beforeTokenTransfer(from, to, tokenId);
    }

    /// @notice support interface
    function supportsInterface(bytes4 interfaceId)
        public
        view
        override
        returns (bool)
    {
        return
            interfaceId == type(INFT).interfaceId ||
            super.supportsInterface(interfaceId);
    }
}
","keccak256":"0x2d4dbf19887ab8e7de4cdca38547d3cb0cb1fe40de1b5a9aeefc9ed542e2154a","license":"MIT"},"contracts/core/CoreNFT.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/utils/Strings.sol";

abstract contract CoreNFT is ERC721, ERC721Enumerable, Ownable {
    string private _uri;
    string private _initName;
    string private _initSymbol;
    uint256 private _tokenIdTracker;

    mapping(uint256 => string) private _tokenURIs;

    function name() public view override returns (string memory) {
        return _initName;
    }

    function symbol() public view override returns (string memory) {
        return _initSymbol;
    }

    function supportsInterface(bytes4 interfaceId)
        public
        view
        virtual
        override(ERC721, ERC721Enumerable)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }

    function tokenURI(uint256 tokenId)
        public
        view
        override
        returns (string memory)
    {   
        return _tokenURIs[tokenId];
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId
    ) internal virtual override(ERC721, ERC721Enumerable) {
        return super._beforeTokenTransfer(from, to, tokenId);
    }

    function _setName(string memory name_) internal {
        _initName = name_;
    }

    function _setSymbol(string memory symbol_) internal {
        _initSymbol = symbol_;
    }

    function _setURI(uint256 tokenId_, string memory uri_) internal {
        _tokenURIs[tokenId_] = uri_;
    }

    function _mint(address account_, string memory uri_) internal virtual {
        _tokenIdTracker = _tokenIdTracker + 1;
        uint256 _tokenId = _tokenIdTracker;
        _safeMint(account_, _tokenId);
        _setURI(_tokenId, uri_);
    }
}
